// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract LibraryContract {
    function doSomething(uint newValue) external pure returns (uint) {
        return newValue + 1;
    }
}

contract Delegator {
    uint public value;

    function callDoSomething(address libraryAddress, uint newValue) public {
        (bool success, bytes memory result) = libraryAddress.delegatecall(
            abi.encodeWithSignature("doSomething(uint256)", newValue)
        );
        require(success, "Delegatecall failed");
        value = abi.decode(result, (uint));
    }
}
